// import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar.js';
import Textform from './Components/Textform';
import About from './Components/About';

function App() {
  return (
    <>
    <Navbar title = "My" />
    <div className="con my-5"> 
    <Textform title = "Enter your text"/>

    </div>
    <About />
    </>
  );
}

export default App;
